import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="bg-light p-3" style={{ minHeight: '100vh', width: '250px', position: 'fixed' }}>
      <h4 className="p-3">Chat App</h4>
      <ul className="list-unstyled">
        <li>
          <Link to="/dashboard" className="d-block p-2 text-dark">Dashboard</Link>
        </li>
        <li>
          <Link to="/user-group" className="d-block p-2 text-dark">User Group</Link>
        </li>
        <li>
          <Link to="/messages" className="d-block p-2 text-dark">Messages</Link>
        </li>
        <li>
          <Link to="/logout" className="d-block p-2 text-dark">Logout</Link>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
